INSERT INTO `servicios` (`id`, `codigoUnidad`, `nombreUnidad`, `descripcionUnidad`, `activo`, `created_at`, `updated_at`) VALUES
(1, 'U.1', 'Medicina general /de familia', 'unidad asistencial en la que un médico/especialista en Medicina familiar y comunitaria es responsable de prestar servicios de prevención y promoción de la salud, diagnóstico o tratamiento básicos en régimen ambulatorio.', 1, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(2, 'U.2', 'Enfermería', 'unidad asistencial en la que personal de Enfermería es responsable de desarrollar funciones y actividades propias de su titulación.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(3, 'U.3', 'Enfermería obstétrico-ginecológica (matrona)', 'unidad asistencial en la que una matrona es responsable de desarrollar funciones y actividades destinadas a prestar atención a las mujeres en el embarazo, parto y puerperio, y al recién nacido.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(4, 'U.4', 'Podología', 'unidad asistencial en la que un podólogo es responsable de prestar cuidados específicos propios de su titulación relacionados con la patología de los pies.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(5, 'U.5', 'Vacunación', 'unidad asistencial donde personal sanitario conserva y administra vacunas. Las funciones de custodia y conservación de éstas estarán bajo la responsabilidad de un farmacéutico.', 1, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(6, 'U.6', 'Alergología', 'unidad asistencial en la que un médico especialista en Alergología es responsable de realizar el estudio, diagnóstico y tratamiento de la patología producida por mecanismos inmunológicos, especialmente de hipersensibilidad.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(7, 'U.7', 'Cardiología', 'unidad asistencial en la que un médico especialista en Cardiología es responsable de realizar el estudio, diagnóstico y tratamiento de las enfermedades cardiovasculares.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(8, 'U.8', 'Dermatología', 'unidad asistencial en la que un médico especialista en Dermatología médico-quirúrgica y Venereología es responsable de realizar el estudio, diagnóstico y tratamiento de pacientes afectados de patología relacionada con la piel y tejidos anejos.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(9, 'U.9', 'Aparato digestivo', 'unidad asistencial en la que un médico especialista en Aparato digestivo es responsable de realizar el estudio, diagnóstico y tratamiento de pacientes afectados de patología digestiva.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(10, 'U.10', 'Endocrinología', 'unidad asistencial en la que un médico especialista en Endocrinología y Nutrición es responsable de realizar el estudio, diagnóstico y tratamiento de pacientes afectados de patología relacionada con el sistema endocrino, así como del metabolismo y de las consecuencias patológicas derivadas de sus alteraciones.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(11, 'U.11', 'Nutrición y dietética', 'unidad asistencial que, bajo la responsabilidad de un facultativo, se encarga de la adecuada nutrición de los pacientes ingresados y de los que precisan continuar el tratamiento tras el ingreso.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(12, 'U.12', 'Geriatría', 'unidad asistencial en la que un médico especialista en Geriatría es responsable de realizar el estudio, diagnóstico y tratamiento de la patología de la edad avanzada.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(13, 'U.13', 'Medicina interna', 'unidad asistencial en la que un médico especialista en Medicina interna es responsable de realizar el estudio, diagnóstico y tratamiento médico de pacientes afectados de patología diversa.', 1, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(14, 'U.14', 'Nefrología', 'unidad asistencial en la que un médico especialista en Nefrología es responsable de realizar el estudio, diagnóstico y tratamiento de pacientes con enfermedades del riÃ±ón y las vías urinarias, así como con procesos generales que pueden tener su origen en un mal funcionamiento renal.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(15, 'U.15', 'Diálisis', 'unidad asistencial en la que un médico especialista en Nefrología es responsable de que se realice el tratamiento con diálisis a pacientes afectados de patología renal.', 1, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(16, 'U.16', 'Neumología', 'unidad asistencial en la que un médico especialista en Neumología es responsable de realizar el estudio, diagnóstico y tratamiento de pacientes afectados de patología respiratoria.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(17, 'U.17', 'Neurología', 'unidad asistencial en la que un médico especialista en Neurología es responsable de realizar el estudio, diagnóstico y tratamiento médico de pacientes afectados de patología relacionada con el sistema nervioso central y periférico.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(18, 'U.18', 'Neurofisiología', 'unidad asistencial en la que un médico especialista en Neurofisiología clínica es responsable de realizar la exploración funcional del sistema nervioso central y periférico, con fines de diagnóstico, pronóstico u orientación terapéutica.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(19, 'U.19', 'Oncología', 'unidad asistencial en la que un médico especialista en Oncología médica es responsable de realizar el estudio, diagnóstico, tratamiento y seguimiento de pacientes con neoplasias.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(20, 'U.20', 'Pediatría', 'unidad asistencial en la que un médico especialista en Pediatría y sus áreas específicas es responsable de prestar cuidados específicos a pacientes en edad pediátrica, encargándose del estudio de su desarrollo, el diagnóstico y el tratamiento de sus enfermedades.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(21, 'U.21', 'Cirugía pediátrica', 'unidad asistencial en la que un médico especialista en Cirugía pediátrica es responsable de realizar el estudio, diagnóstico y tratamiento en procesos quirúrgicos específicos de la edad infantil.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(22, 'U.22', 'Cuidados intermedios neonatales', 'unidad asistencial en la que, bajo la responsabilidad de un médico especialista en Pediatría y sus áreas específicas, se realiza la atención del recién nacido de edad gestacional superior a 32 semanas o peso superior a 1.500 gramos con patología leve que necesita técnicas especiales de cuidados medios.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(23, 'U.23', 'Cuidados intensivos neonatales', 'unidad asistencial en la que, bajo la responsabilidad de un médico especialista en Pediatría y sus áreas específicas, se realiza la atención del recién nacido con patología médico-quirúrgica, con compromiso vital, que precisa de medios y cuidados especiales de forma continuada.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(24, 'U.24', 'Reumatología', 'unidad asistencial en la que un médico especialista en Reumatología es responsable de realizar el estudio, diagnóstico y tratamiento de pacientes afectados de patología reumática.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(25, 'U.25', 'Obstetricia', 'unidad asistencial en la que un médico especialista en Obstetricia y Ginecología es responsable de prestar la atención del embarazo, parto y puerperio.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(26, 'U.26', 'Ginecología', 'unidad asistencial en la que un médico especialista en Obstetricia y Ginecología es responsable de realizar el estudio, diagnóstico y tratamiento de patología inherente al aparato genital femenino y la mama.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(27, 'U.27', 'Inseminación artificial', 'unidad asistencial que, bajo la responsabilidad de un médico especialista en Obstetricia y Ginecología, tiene como finalidad la fecundación humana mediante inseminación artificial con semen fresco, capacitado o crioconservado, procedente del varón de la pareja o de donante, según el caso.', 1, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(28, 'U.28', 'Fecundación in vitro', 'unidad asistencial que, bajo la responsabilidad de un médico especialista en Obstetricia y Ginecología y un facultativo con formación y experiencia en biología de la reproducción, tiene por finalidad la fecundación mediante transferencia de embriones, transferencia intratubárica de gametos y otras técnicas afines previamente evaluadas.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(29, 'U.29', 'Banco de semen', 'unidad asistencial que, bajo la responsabilidad de un facultativo, tiene como finalidad la obtención, evaluación, conservación y distribución de semen humano para su utilización en las técnicas de reproducción humana asistida y que desarrollan además las actividades precisas para la selección y control de los donantes.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(30, 'U.30', 'Laboratorio de semen para capacitación espermática', 'unidad asistencial que, bajo la responsabilidad de un facultativo, lleva a cabo la adecuación de los espermatozoides para su función reproductora.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(31, 'U.31', 'Banco de embriones', 'unidad asistencial que, bajo la responsabilidad de un facultativo, se encarga de la crioconservación de embriones para transferencias con fines procreadores o métodos de investigación/experimentación legalmente autorizados.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(32, 'U.32', 'Recuperación de oocitos', 'unidad asistencial que, bajo la responsabilidad de un facultativo, se encarga de la realización de las actividades precisas para la obtención y el tratamiento de gametos con fines procreadores o métodos de investigación/experimentación legalmente autorizados.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(33, 'U.33', 'Planificación familiar', 'unidad asistencial en la que un médico especialista en Obstetricia y Ginecología es responsable de prestar servicios de atención, información y asesoramiento relacionados con la reproducción, concepción y contracepción humana.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(34, 'U.34', 'Interrupción voluntaria del embarazo', 'unidad asistencial en la que un médico especialista en Obstetricia y Ginecología es responsable de llevar a cabo la práctica del aborto terapéutico y eugenésico, en los supuestos legalmente permitidos.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(35, 'U.35', 'Anestesia y reanimación', 'unidad asistencial en la que un médico especialista en Anestesiología y Reanimación es responsable de aplicar al paciente técnicas y métodos para hacerle insensible al dolor y protegerle de la agresión antes, durante y después de cualquier intervención quirúrgica u obstétrica, de exploraciones diagnósticas y de traumatismos, así como de mantener sus condiciones vitales en cualquiera de las situaciones citadas.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(36, 'U.36', 'Tratamiento del dolor', 'unidad asistencial en la que un médico especialista es responsable de aplicar técnicas y métodos para eliminar o aliviar el dolor, de cualquier etiología, al paciente.', 1, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(37, 'U.37', 'Medicina intensiva', 'unidad asistencial en la que un médico especialista en Medicina intensiva es responsable de que se preste la atención sanitaria precisa, continua e inmediata, a pacientes con alteraciones fisiopatológicas que han alcanzado un nivel de severidad tal que representan una amenaza actual o potencial para su vida y, al mismo tiempo, son susceptibles de recuperación.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(38, 'U.38', 'Quemados', 'unidad asistencial pluridisciplinar que, bajo la responsabilidad de un médico especialista, atiende a pacientes afectados por lesiones producidas por alteraciones térmicas en los tejidos y que por su extensión, profundidad o localización son consideradas graves o críticas.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(39, 'U.39', 'Angiología y cirugía vascular', 'unidad asistencial en la que un médico especialista en Angiología y Cirugía vascular es responsable de realizar el estudio, diagnóstico y tratamiento, médico y quirúrgico, de las enfermedades vasculares, exceptuando las cardiacas e intracraneales.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(40, 'U.40', 'Cirugía cardiaca', 'unidad asistencial en la que un médico especialista en Cirugía cardiovascular es responsable de realizar el estudio y tratamiento quirúrgico de patologías cardiacas.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(41, 'U.41', 'Hemodinámica', 'unidad asistencial en la que, bajo la responsabilidad de un médico especialista con experiencia en Hemodinamia, se realizan procesos vasculares o cardiológicos intervencionistas con finalidad diagnóstica y/o terapéutica.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(42, 'U.42', 'Cirugía torácica', 'unidad asistencial en la que un médico especialista en Cirugía torácica es responsable de realizar el estudio y tratamiento de los procesos específicos que afectan a la región anatómica del tórax, que incluye pared torácica, pleura, pulmón, mediastino, árbol traqueo-bronquial, esófago y diafragma.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(43, 'U.43', 'Cirugía general y digestivo', 'unidad asistencial en la que un médico especialista en Cirugía general y del aparato digestivo es responsable de realizar las intervenciones en procesos quirúrgicos relativos a patología abdominal, del aparato digestivo, del sistema endocrino, de la cabeza y cuello (con exclusión de la patología específica de otras especialidades quirúrgicas), de la mama y de la piel y partes blandas.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(44, 'U.44', 'Odontología/estomatología', 'unidad asistencial en la que un odontólogo o estomatólogo es responsable de realizar actividades profesionales encaminadas a la promoción de la salud bucodental, llevando a cabo la prevención, diagnóstico y tratamiento de las anomalías y enfermedades de los dientes, la boca, los maxilares y los tejidos anejos en el individuo y en la comunidad, así como la prescripción de medicamentos, prótesis y productos sanitarios en el ámbito de su ejercicio profesional.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(45, 'U.45', 'Cirugía maxilofacial', 'unidad asistencial en la que un médico especialista en Cirugía oral y maxilofacial es responsable de realizar el estudio, diagnóstico y tratamiento de las enfermedades de la cavidad bucal y de la cara.', 1, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(46, 'U.46', 'Cirugía plástica y reparadora', 'unidad asistencial en la que un médico especialista en Cirugía plástica, estética y reparadora es responsable de realizar la corrección quirúrgica de procesos congénitos, adquiridos, tumorales o involutivos que requieren reparación o reposición de estructuras superficiales que afectan a la forma y función corporal.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(47, 'U.47', 'Cirugía estética', 'unidad asistencial en la que un médico especialista en Cirugía plástica, estética y reparadora u otro especialista quirúrgico en el ámbito de su respectiva especialidad es responsable de realizar tratamientos quirúrgicos, con finalidad de mejora estética corporal, facial o capilar.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(48, 'U.48', 'Medicina cosmética', 'unidad asistencial en la que un médico es responsable de realizar tratamientos no quirúrgicos, con finalidad de mejora estética corporal o facial.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(49, 'U.49', 'Neurocirugía', 'unidad asistencial en la que un médico especialista en Neurocirugía es responsable de realizar intervenciones a pacientes con procesos quirúrgicos relativos al sistema nervioso.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(50, 'U.50', 'Oftalmología', 'unidad asistencial en la que un médico especialista en Oftalmología es responsable de realizar el estudio, diagnóstico y tratamiento de los defectos y enfermedades de los órganos de la visión.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(51, 'U.51', 'Cirugía refractiva', 'unidad asistencial en la que un médico especialista en Oftalmología es responsable de realizar toda una serie de técnicas quirúrgicas destinadas a modificar los defectos de refracción, bien mediante el uso del láser o mediante cirugía intraocular.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(52, 'U.52', 'Otorrinolaringología', 'unidad asistencial en la que un médico especialista en Otorrinolaringología es responsable de realizar el estudio, diagnóstico y tratamiento de procesos patológicos del oído, fosas nasales y senos paranasales, faringe y laringe.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(53, 'U.53', 'Urología', 'unidad asistencial en la que un médico especialista en Urología es responsable de realizar el estudio, diagnóstico y tratamiento de afecciones específicas del aparato urinario masculino y femenino y del aparato genital masculino.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(54, 'U.54', 'Litotricia renal', 'unidad asistencial en la que un médico especialista en Urología es responsable de realizar tratamientos, mediante un litotritor, de fragmentación de cálculos renales.', 1, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(55, 'U.55', 'Cirugía ortopédica y traumatología', 'unidad asistencial en la que un médico especialista en Cirugía ortopédica y traumatología es responsable de realizar el estudio, desarrollo, conservación y restablecimiento de la forma y de la función de las estructuras músculo-esqueléticas, por medios médicos, quirúrgicos y físicos.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(56, 'U.56', 'Lesionados medulares', 'unidad asistencial pluridisciplinar en la que, bajo la supervisión de un médico especialista, se proporciona asistencia sanitaria especializada y rehabilitación integral a todas las personas afectadas por una lesión medular (paraplejia y tetraplejia) o cualquier otra gran discapacidad física, desde una perspectiva que contempla tanto los aspectos médico-quirúrgicos como los psicológicos y sociales.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(57, 'U.57', 'Rehabilitación', 'unidad asistencial en la que un médico especialista en Medicina física y rehabilitación es responsable de realizar el diagnóstico, evaluación, prevención y tratamiento de la incapacidad encaminándolos a facilitar, mantener o devolver el mayor grado de capacidad funcional e independencia posible al paciente incapacitado, con el fin de integrarlo en su medio habitual.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(58, 'U.58', 'Hidrología', 'unidad asistencial en la que un médico especialista en Hidrología médica es responsable de la utilización de aguas mineromedicinales y termales con fines terapéuticos y preventivos para la salud.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(59, 'U.59', 'Fisioterapia', 'unidad asistencial en la que un fisioterapeuta es responsable de realizar funciones y actividades propias de su titulación, con finalidad preventiva, educativa o terapéutica, para el tratamiento de las enfermedades que cursan con discapacidades o la recuperación de la funcionalidad utilizando agentes físicos.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(60, 'U.60', 'Terapia ocupacional', 'unidad asistencial en la que, bajo la responsabilidad de un terapeuta ocupacional, se utilizan con fines terapéuticos las actividades de autocuidado, trabajo y ocio para que los pacientes adquieran el conocimiento, las destrezas y actitudes necesarias para desarrollar las tareas cotidianas requeridas y consigan el máximo de autonomía e integración.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(61, 'U.61', 'Logopedia', 'unidad asistencial en la que un logopeda es responsable de realizar la prevención, el estudio y la corrección de los trastornos del lenguaje.', 1, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(62, 'U.62', 'Foniatría', 'unidad asistencial en la que un médico es responsable de estudiar y proporcionar tratamientos a pacientes afectados de alteraciones de la voz y su mecanismo.', 1, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(63, 'U.63', 'Cirugía mayor ambulatoria', 'unidad asistencial que, bajo la responsabilidad de un médico especialista, se dedica a la realización de procedimientos quirúrgicos terapéuticos o diagnósticos, realizados con anestesia general, loco-regional o local, con o sin sedación, que requieren cuidados postoperatorios de corta duración, por lo que no necesitan ingreso hospitalario.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(64, 'U.64', 'Cirugía menor ambulatoria', 'unidad asistencial donde, bajo la responsabilidad de un médico, se realizan procedimientos terapéuticos o diagnósticos de baja complejidad y mínimamente invasivos, con bajo riesgo de hemorragia, que se practican bajo anestesia local y que no requieren cuidados postoperatorios, en pacientes que no precisan ingreso.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(65, 'U.65', 'Hospital de día', 'unidad asistencial donde, bajo la supervisión o indicación de un médico especialista, se lleva a cabo el tratamiento o los cuidados de enfermos que deben ser sometidos a métodos de diagnóstico o tratamiento que requieran durante unas horas atención continuada médica o de enfermería, pero no el internamiento en el hospital.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(66, 'U.66', 'Atención sanitaria domiciliaria', 'unidad asistencial pluridisciplinar que, bajo la supervisión o indicación de un médico, desarrolla actividades para prestar atención sanitaria a personas enfermas en su propio domicilio.', 1, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(67, 'U.67', 'Cuidados paliativos', 'unidad asistencial pluridisciplinar, con o sin equipos de cuidados domiciliarios, que bajo la responsabilidad de un médico, presta la atención a pacientes en situación terminal.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(68, 'U.68', 'Urgencias', 'unidad asistencial que, bajo la responsabilidad de un médico, está destinada a la atención sanitaria de pacientes con problemas de etiología diversa y gravedad variable, que generan procesos agudos que necesitan de atención inmediata.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(69, 'U.69', 'Psiquiatría', 'unidad asistencial en la que un médico especialista en Psiquiatría es responsable de realizar el estudio, diagnóstico y tratamiento de los trastornos mentales y del comportamiento.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(70, 'U.70', 'Psicología clínica', 'unidad asistencial en la que un psicólogo especialista en Psicología clínica, dentro del campo de su titulación, es responsable de realizar diagnósticos, evaluaciones y tratamientos de carácter psicológico de aquellos fenómenos psicológicos, conductales y relacionales que inciden en la salud de los seres humanos.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(71, 'U.71', 'Atención sanitaria a drogodependientes', 'unidad asistencial pluridisciplinar en la que, bajo la supervisión de un facultativo sanitario, se prestan servicios de prevención, atención y rehabilitación al drogodependiente, mediante la aplicación de técnicas terapéuticas.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(72, 'U.72', 'Obtención de muestras', 'unidad asistencial, vinculada a un laboratorio clínico, en la que personal sanitario con titulación adecuada realiza la obtención, recepción, identificación, preparación y conservación de los especímenes o muestras biológicas de origen humano, responsabilizándose de la muestra hasta su entrega al laboratorio correspondiente.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(73, 'U.73', 'Análisis clínicos', 'unidad asistencial que, bajo la responsabilidad de un facultativo especialista en Análisis clínicos, realiza una serie de actuaciones que a través de pruebas diagnósticas analíticas, pruebas funcionales o de laboratorio y su correlación fisiopatológica ayudan al diagnóstico, pronóstico, terapéutica médica y prevención de la enfermedad.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(74, 'U.74', 'Bioquímica clínica', 'unidad asistencial que, bajo la responsabilidad de un facultativo especialista en Bioquímica clínica, aplica los métodos químicos y bioquímicos de laboratorio necesarios para la prevención, diagnóstico, pronóstico y evolución de la enfermedad, así como de su respuesta al tratamiento.', 1, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(75, 'U.75', 'Inmunología', 'unidad asistencial que, bajo la responsabilidad de un facultativo especialista en Inmunología, está dedicada a obtener la información necesaria para el estudio, diagnóstico y tratamiento de pacientes con enfermedades causadas por alteraciones de los mecanismos inmunológicos y de las situaciones en las que las manipulaciones inmunológicas forman una parte importante del tratamiento o de la prevención.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(76, 'U.76', 'Microbiología y parasitología', 'unidad asistencial que, bajo la responsabilidad de un facultativo especialista en Microbiología y Parasitología, está dedicada al estudio de los microorganismos relacionados con la especie humana, centrándose en el hombre enfermo o portador de enfermedades infecciosas para su diagnóstico, estudio epidemiológico y orientación terapéutica.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(77, 'U.77', 'Anatomía patológica', 'unidad asistencial en la que, bajo la responsabilidad de un médico especialista en Anatomía patológica, se realizan estudios, por medio de técnicas morfológicas, de las causas, desarrollo y consecuencias de la enfermedad, siendo su finalidad el diagnóstico correcto de biopsias, piezas quirúrgicas, citologías y autopsias.', 1, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(78, 'U.78', 'Genética', 'unidad asistencial que, bajo la responsabilidad de un facultativo con formación adecuada, está dedicada a la realización de pruebas genéticas y la emisión de los dictámenes correspondientes con fines diagnósticos.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(79, 'U.79', 'Hematología clínica', 'unidad asistencial en la que un médico especialista en Hematología y Hemoterapia es responsable de realizar el estudio, diagnóstico y tratamiento de pacientes afectados de patología relacionada con la sangre y los órganos hematopoyéticos.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(80, 'U.80', 'Laboratorio de hematología', 'unidad asistencial que, bajo la responsabilidad de un médico especialista en Hematología y Hemoterapia, está dedicada a la obtención de muestras de origen humano, a la realización de determinaciones hematológicas y la emisión de los dictámenes correspondientes con fines diagnósticos.', 1, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(81, 'U.81', 'Extracción de sangre para donación', 'unidad asistencial, vinculada a un centro de transfusión, en la que, bajo la responsabilidad de un médico, se efectúan extracciones de sangre, por personal de enfermería debidamente entrenado, en un vehículo o en salas públicas o privadas adaptadas al efecto.', 1, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(82, 'U.82', 'Servicio de transfusión', 'unidad asistencial de un centro hospitalario, vinculada a un centro de transfusión, en la que, bajo la responsabilidad de un médico especialista en Hematología y Hemoterapia, se almacena y distribuye sangre y componentes sanguíneos y en la que se pueden realizar pruebas de compatibilidad de sangre y componentes para uso exclusivo en sus instalaciones, incluidas las actividades de transfusión hospitalaria.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(83, 'U.83', 'Farmacia', 'unidad asistencial que, bajo la responsabilidad de un farmacéutico, o farmacéutico especialista en Farmacia hospitalaria en el caso de hospitales, lleva a cabo la selección, adquisición, conservación, dispensación, preparación, seguimiento e información sobre los medicamentos a utilizar en el centro y aquellos que requieren una especial vigilancia, supervisión y control del equipo multidisciplinar de salud.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(84, 'U.84', 'Depósito de medicamentos', 'unidad asistencial, dependiente de una oficina o servicio de farmacia, en la que se conservan y dispensan medicamentos a los pacientes atendidos en el centro en el que está ubicada.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(85, 'U.85', 'Farmacología clínica', 'unidad asistencial en la que un médico especialista en Farmacología clínica es responsable de realizar el estudio del efecto de los medicamentos en el hombre, observando y cuantificando sus efectos farmacológicos, la evaluación de sus efectos terapéuticos y analizando las reacciones adversas.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(86, 'U.86', 'Radioterapia', 'unidad asistencial en la que, bajo la responsabilidad de un médico especialista en Oncología radioterápica, se llevan a cabo tratamientos con radiaciones ionizantes y terapéuticas asociadas, fundamentalmente en el caso de pacientes oncológicos.', 1, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(87, 'U.87', 'Medicina nuclear', 'unidad asistencial en la que, bajo la responsabilidad de un médico especialista en Medicina nuclear, se realizan procesos diagnósticos o terapéuticos mediante isótopos radiactivos, radiaciones nucleares, variaciones electromagnéticas del núcleo atómico y técnicas biofísicas similares.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(88, 'U.88', 'Radiodiagnóstico', 'unidad asistencial que, bajo la responsabilidad de un médico especialista en Radiodiagnóstico, está dedicada al diagnóstico y tratamiento de las enfermedades utilizando como soporte técnico fundamental las imágenes y datos funcionales obtenidos por medio de radiaciones ionizantes o no ionizantes y otras fuentes de energía.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(89, 'U.89', 'Asistencia a lesionados y contaminados por elementos radiactivos y radiaciones ionizantes', 'unidad asistencial que, bajo la responsabilidad de un médico, lleva a cabo el tratamiento de las secuelas radiactivas, profesionales o de origen fortuito que sean padecidas por personas o colectivos humanos.', 1, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(90, 'U.90', 'Medicina preventiva', 'unidad asistencial que, bajo la responsabilidad de un médico especialista en Medicina preventiva y salud pública, lleva a cabo funciones de control interno para evitar y prevenir los riesgos para la salud de los pacientes derivados de las actividades del centro sanitario en el que esté ubicada.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(91, 'U.91', 'Medicina de la educación física y el deporte', 'unidad asistencial en la que un médico especialista en Medicina de la educación física y el deporte es responsable de realizar estudios de las funciones orgánicas y realiza diagnósticos y tratamientos específicos para personas que se dedican a la práctica deportiva.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(92, 'U.92', 'Medicina hiperbárica', 'unidad asistencial vinculada a un centro hospitalario, que bajo la responsabilidad de un médico, tiene como finalidad la administración de oxígeno puro al organismo, en un medio presurizado, con fines diagnósticos o terapéuticos.', 1, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(93, 'U.93', 'Extracción de órganos', 'unidad asistencial, que bajo la responsabilidad de un médico especialista, se encarga de la obtención mediante extracción de órganos de donante vivo o fallecido para su implantación en un organismo receptor, de acuerdo con la legislación vigente sobre la materia.', 1, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(94, 'U.94', 'Trasplante de órganos', 'unidad asistencial, que bajo la responsabilidad de un médico especialista, tiene como finalidad la utilización terapéutica de los órganos humanos, que consiste en sustituir un órgano enfermo, o su función, por otro sano procedente de un donante vivo o fallecido, de acuerdo con la legislación vigente sobre la materia.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(95, 'U.95', 'Obtención de tejidos', 'unidad asistencial que, bajo la responsabilidad de un médico especialista, realiza cualquiera de las actividades destinadas a disponer de tejidos y células de origen humano o a posibilitar el uso de residuos quirúrgicos con las finalidades a que se refiere la normativa vigente sobre la materia.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(96, 'U.96', 'Implantación de tejidos', 'unidad asistencial que, bajo la responsabilidad de un médico especialista, realiza cualquiera de las actividades que implican utilización terapéutica de tejidos humanos, y engloba las acciones de trasplantar, injertar o implantar.', 1, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(97, 'U.97', 'Banco de tejidos', 'unidad técnica que, bajo la responsabilidad de un facultativo, tiene por misión conservar y garantizar la calidad de los tejidos, después de su obtención y hasta su utilización clínica como aloinjertos o autoinjertos.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(98, 'U.98', 'Medicina aeronáutica', 'unidad asistencial en la que, bajo la responsabilidad de un médico examinador autorizado según establece la normativa vigente, se realizan los reconocimientos, informes y evaluaciones médicas requeridas para la emisión de los certificados médicos exigidos a los titulares de licencias y habilitaciones aeronáuticas, por las normas reguladoras de éstas.', 1, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(99, 'U.99', 'Medicina del trabajo', 'unidad preventivo-asistencial que, bajo la responsabilidad de un médico especialista en Medicina del trabajo o diplomado en Medicina de empresa, desarrolla las funciones de vigilancia de la salud de los trabajadores reguladas por la Ley de Prevención de Riesgos Laborales y su normativa de desarrollo.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(100, 'U.100', 'Transporte sanitario (carretera, aéreo, marítimo)', 'unidad asistencial que tiene por objeto el desplazamiento de personas enfermas, accidentadas o por otra razón sanitaria, en vehículos terrestres, aéreos o marítimos, especialmente acondicionados al efecto.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(101, 'U.101', 'Terapias no convencionales', 'unidad asistencial en la que un médico es responsable de realizar tratamientos de las enfermedades por medios de medicina naturista o con medicamentos homeopáticos o mediante técnicas de estimulación periférica con agujas u otros que demuestren su eficacia y su seguridad.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38'),
(102, 'U.900', 'Otras unidades asistenciales', 'unidades que, bajo la responsabilidad de profesionales sanitarios, capacitados por su titulación oficial o habilitación profesional, no se ajustan a las características de ninguna de las anteriormente definidas por realizar actividades sanitarias innovadoras o en fase de evaluación clínica.', 0, '2018-08-23 07:10:20', '2018-08-23 07:10:38');
